import HomePage from './pages/HomePage';
import './App.css';
import LoginPage from './pages/LoginPage';
import SignupPage from './pages/SignupPage';
import ProblemsPage from './pages/ProblemsPage';
function App() {
  return (
    <div className="App">
      {/* <HomePage /> */}
      <LoginPage/>
      <SignupPage />
      <ProblemsPage/>
    </div>
  );
}

export default App;
